public void updateAutoCreate()
{
    if(HMBillParameters.AutoCreateBill == NoYes::No)
    {
        HMBillParameters_AutoCreateBillEvent.enabled(false);
    }
    else
    {
        HMBillParameters_AutoCreateBillEvent.enabled(true);
    }

}

